    [],nt"revision_timestamp": "2015-08-21T22:45:31.181444",nt"name": "patient-advocate-tracking-system-pats",nt"isopen":
    true,nt"url": null,nt"notes": "The Patient Advocate Tracking System (PATS)
    is a centralized, web based application that records and tracks instances of patient
    compliments and complaints concerning their care at VA health care facilities. These
    instances of patient contacts may come from a variety of sources including the patient,
    family members, congressional members and/or Veterans service organizations on behalf
    of the Veterans receiving care at VA facilities. This database provides a menu of
    reports that can be used to track and trend data across Veterans Integrated Service
    Networks (VISNs). Reports of contact allow the Patient Advocate to trend compliments
    and complaints, and ensure that issues raised are resolved. The reports include
    data such as patient demographics, date of contact, method of contact, who made
    the contact, issues involved, what service was involved, resolution date and resolution
    status. Data is collected from Veterans Affairs Medical Centers and sent to the
    VHA Support Service Center (VSSC) where the data is maintained and reports created.",nt"license_title":
